	<p>–°–µ–º–µ–Ω–æ–≤—Å—å–∫–æ–≥–æ –∑–¥—ñ–π—Å–Ω—é—é—Ç—å —Ü—ñ–∫–∞–≤—ñ –æ–±—Ä–æ–±–∫–∏ —É–∫—Ä–∞—ó–Ω—Å—å–∫–∏—Ö –Ω–∞—Ä–æ–¥–Ω–∏—Ö —ñ –∞–≤—Ç–æ—Ä—Å—å–∫–∏—Ö –ø—ñ—Å–µ–Ω—å, –Ω–∞—Ä–æ–¥–Ω–∏—Ö —Ç–∞–Ω—Ü—ñ–≤ —É –æ—Ä–∏–≥—ñ–Ω–∞–ª—å–Ω–∏—Ö –ø–æ—Å—Ç–∞–Ω–æ–≤–∫–∞—Ö, –º–∞—Å—à—Ç–∞–±–Ω–∏—Ö –≤–æ–∫–∞–ª—å–Ω–æ-—Ö–æ—Ä–µ–æ–≥—Ä–∞—Ñ—ñ—á–Ω–∏—Ö –∫–æ–º–ø–æ–∑–∏—Ü—ñ–π, –∫–æ—Ç—Ä—ñ –ø—Ä–µ–∑–µ–Ω—Ç—É—é—Ç—å —è–∫ –Ω–∞ –∫—Ä–∞—â–∏—Ö —Å—Ü–µ–Ω–∞—Ö –º. –ö–∏—î–≤–∞, —Ç–∞–∫ —ñ –Ω–∞ –≤—ñ–¥–¥–∞–ª–µ–Ω–∏—Ö –≤—ñ–¥ —Å—Ç–æ–ª–∏—Ü—ñ —Å—ñ–ª—å—Å—å–∫–∏—Ö –∫–æ–Ω—Ü–µ—Ä—Ç–Ω–∏—Ö –º–∞–π–¥–∞–Ω—á–∏–∫–∞—Ö. –î—É—Ö–æ–≤–∏–π –æ—Ä–∫–µ—Å—Ç—Ä, –∑–∞—Å–Ω–æ–≤–∞–Ω–∏–π —É —Ä. –ù–∞—Ä–æ–¥–Ω–∏–π —Å—Ç—É–¥–µ–Ω—Ç—Å—å–∫–∏–π —Ç–µ–∞—Ç—Ä ¬´–ë–µ—Ä–µ–∑—ñ–ª—å¬ª , —Å—Ç–≤–æ—Ä–µ–Ω–∏–π —É —Ä. –©–µ—Ä–±–∞–∫–∞, ¬´–¶–∏–ª—ñ–Ω–¥—Ä¬ª –ï. –®–∏–ª–ª–µ—Ä–∞, ¬´–ö–æ—Ö–∞–Ω–Ω—è –ø–æ-—Ñ—Ä–∞–Ω—Ü—É–∑—å–∫–∏¬ª –ú. –ö–∞–º—É–ª–µ—Ç—Ç—ñ, ¬† ¬´–í–µ—Å—ñ–ª–ª—è –§—ñ–≥–∞—Ä–æ¬ª –ü. –û—Å—Ç—Ä–æ–≤—Å—å–∫–æ–≥–æ, ¬´–ú—ñ–ª—å–π–æ–Ω —É –≤–µ—Å—ñ–ª—å–Ω–æ–º—É –∫–æ—à–∏–∫—É¬ª –î.</p>
<p>–°–∫–∞—Ä–Ω–∞—á—á—ñ —Ç–∞ –†. –¢–∞—Ä–∞–±—É–∑—ñ, ¬´–ë–µ–∑—ñ–º–µ–Ω–Ω–∞ –∑—ñ—Ä–∫–∞¬ª –ú. –°–µ–±–∞—Å—Ç—ñ–∞–Ω–∞, ¬´–í –±—ñ–π —ñ–¥—É—Ç—å —Ç—ñ–ª—å–∫–∏ —Å—Ç–∞—Ä—ñ¬ª –õ. –ë–∏–∫–æ–≤–∞, –Ñ. –û–Ω–æ–ø—Ä—ñ—î–Ω–∫–∞, –û. –°–∞—Ü—å–∫–æ–≥–æ, ¬´–ó–¥—Ä–∞—Å—Ç—É–π—Ç–µ, —è –≤–∞—à–∞ —Ç—ñ—Ç–æ–Ω—å–∫–∞¬ª –ë—Ä–µ–Ω–¥–æ–Ω–∞ –¢–æ–º–∞—Å–∞ ¬† —Ç–∞ –±–∞–≥–∞—Ç–æ —ñ–Ω—à–∏—Ö. –£ —Ä–µ–ø–µ—Ä—Ç—É–∞—Ä—ñ –∂—ñ–Ω–æ—á–æ–≥–æ –≤ –æ–∫–∞–ª—å–Ω–æ–≥–æ –∞–Ω—Å–∞–º–±–ª—é ¬´–û–∫—Ç–∞–≤–∞¬ª ‚Äî ¬† –¥–∂–∞–∑–æ–≤—ñ –∫–æ–º–ø–æ–∑–∏—Ü—ñ—ó, —Å—É—á–∞—Å–Ω—ñ –æ–±—Ä–æ–±–∫–∏ –Ω–∞—Ä–æ–¥–Ω–∏—Ö –ø—ñ—Å–µ–Ω—å —Å–≤—ñ—Ç—É, –Ω–∏–∑–∫–∞ —É–∫—Ä–∞—ó–Ω—Å—å–∫–∏—Ö –ø—ñ—Å–µ–Ω—å, –∑–∞–≤–¥—è–∫–∏ —è–∫–∏–º –≤—ñ–Ω —Å—Ç–∞–≤ –Ω–µ–æ–¥–Ω–æ—Ä–∞–∑–æ–≤–∏–º –ª–∞—É—Ä–µ–∞—Ç–æ–º –≤—Å–µ—É–∫—Ä–∞—ó–Ω—Å—å–∫–∏—Ö –∫–æ–Ω–∫—É—Ä—Å—ñ–≤ —Ç–∞ —Ñ–µ—Å—Ç–∏–≤–∞–ª—ñ–≤.</p>
